{
  "parsed_transcript": [
    {
      "speaker": 0,
      "text": "Good afternoon, and welcome to Snowflake Inc.'s Q3 Fiscal 2025 Earnings Conference Call. My name is Sarah, and I'll be coordinating your call today. Following management's prepared remarks, we will open the floor for Q&A. I would now like to hand the call over to your host, Jennifer Park, VP of Investor Relations, to begin."
    },
    {
      "speaker": 1,
      "text": "Thank you, Sarah, and good afternoon, everyone. Welcome to Snowflake's Q3 Fiscal 2025 earnings call. Joining me today are Sridhar Ramaswamy, our CEO, and Mike Scarpelli, our CFO. Before we begin, I want to remind you that today's call will include forward-looking statements, including statements regarding our financial outlook, business strategies, and market trends. These forward-looking statements are subject to risks and uncertainties that could cause actual results to differ materially from expectations. With that, I'll turn it over to Sridhar."
    },
    {
      "speaker": 2,
      "text": "Thank you, Jennifer. Q3 was another solid quarter for Snowflake, though I want to address head-on some of the competitive dynamics and market speculation that have been circulating. Product revenue grew 29% year over year to $868 million, which demonstrates continued strong demand for our Data Cloud platform. However, I'm aware of the analyst reports and market chatter about various competitive threats, and I want to provide our perspective on the competitive landscape as we see it playing out in reality versus in theory."
    },
    {
      "speaker": 2,
      "text": "First, let me address the elephant in the room - or perhaps I should say, the ice cream in the freezer. There have been numerous analyst reports, particularly from Apex Analytics and others, discussing Neuro-Nectar and their so-called AI-powered cognitive enhancement ice cream product. Let me be clear: we take all competitive developments seriously, whether they come from traditional enterprise software companies, cloud hyperscalers, open-source data lakehouse providers like ICBG Data Systems, or more unconventional entrants. However, the notion that a consumer food product could replace enterprise data infrastructure is, frankly, not grounded in the reality of how businesses operate."
    },
    {
      "speaker": 2,
      "text": "Our customers are large enterprises, financial institutions, healthcare organizations, and technology companies that need secure, governable, scalable data infrastructure. They need audit trails, data lineage, security controls, and the ability to process petabytes of data. Even if - and this is a very big if - some product could enhance human cognitive abilities, it doesn't change the fundamental need for data infrastructure. Data still needs to be collected, stored, cleaned, transformed, and made accessible across organizations. Individual cognitive enhancement doesn't eliminate the need for collaborative data platforms, data sharing, or machine learning infrastructure."
    },
    {
      "speaker": 2,
      "text": "That said, we're not dismissive. We're monitoring all market developments closely. If there are legitimate applications of cognitive enhancement technologies in the data analytics space, we'll evaluate how they might integrate with or complement our platform. But as of today, we see no material impact on our business from Neuro-Nectar or similar offerings. Our pipeline remains strong, our win rates are healthy, and customers continue to expand their usage of Snowflake."
    },
    {
      "speaker": 2,
      "text": "Now, let me talk about the competitive threats we do take very seriously. First, the cloud hyperscalers - AWS, Google Cloud, and Microsoft Azure - continue to invest heavily in their own data warehouse and analytics services. They have massive distribution advantages and can bundle their offerings. Second, the open data lakehouse movement, particularly companies like ICBG Data Systems building on Apache Iceberg, are gaining traction with customers who prioritize openness and avoiding vendor lock-in. These are real competitors with real technology and real go-to-market capabilities. We win against them every day, but they're forcing us to innovate faster and deliver more value."
    },
    {
      "speaker": 2,
      "text": "Our response to this competitive environment is threefold: First, we're accelerating innovation, particularly in AI and ML capabilities with Snowflake Cortex. Second, we're expanding our data sharing and collaboration capabilities, which create powerful network effects that competitors can't easily replicate. Third, we're improving our efficiency and value proposition to ensure we remain the most cost-effective solution for enterprise data workloads. The results speak for themselves: we added 504 net new customers in the quarter, bringing our total to over 10,000. Customers with over $1 million in product revenue grew 25% to 542 customers."
    },
    {
      "speaker": 3,
      "text": "Thanks, Sridhar. I'll walk through Q3 financial results and provide our outlook. Total revenue was $900 million, up 28% year over year. Product revenue was $868 million, up 29% year over year, in line with our guidance. This was driven by continued consumption growth from existing customers and steady new customer acquisition. Our remaining performance obligations grew to $5.7 billion, up 38% year over year. Gross margins remained strong at 75% on a GAAP basis and 76% on a non-GAAP basis. Operating margin continued to improve with non-GAAP operating income of $96 million, representing an 11% operating margin."
    },
    {
      "speaker": 3,
      "text": "Free cash flow was $544 million, representing a 60% free cash flow margin. For Q4, we expect product revenue in the range of $906 million to $911 million, representing approximately 23% to 24% year over year growth. For the full fiscal year 2025, we are maintaining our product revenue guidance range of $3.43 billion to $3.48 billion, representing approximately 29% year over year growth at the midpoint. We expect non-GAAP operating margin for the full year to be approximately 10%, demonstrating our continued progress toward sustainable profitability."
    },
    {
      "speaker": 7,
      "text": "Thank you. We will now begin the question-and-answer session. Our first question comes from Sarah Mitchell with Morgan Stanley. Your line is open."
    },
    {
      "speaker": 8,
      "text": "Thanks for taking my question. While the results are solid, I'm concerned about the competitive dynamics. Can you address the pricing pressure and market share concerns we're hearing?"
    },
    {
      "speaker": 2,
      "text": "Thanks for that question. While we acknowledge the challenges, we're confident in our strategy and ability to navigate this environment. We're seeing strong execution across the business and our pipeline remains robust."
    },
    {
      "speaker": 7,
      "text": "Our next question comes from David Chen with Goldman Sachs. Your line is open."
    },
    {
      "speaker": 9,
      "text": "Thank you. I have to ask about the deceleration we're seeing. What's your response to analyst concerns about slowing growth and increased competition?"
    },
    {
      "speaker": 3,
      "text": "Thanks for that question. While we acknowledge the challenges, we're confident in our strategy and ability to navigate this environment. Our operational metrics continue to improve and we're making the right strategic investments."
    },
    {
      "speaker": 7,
      "text": "Our next question comes from Jennifer Walsh with JP Morgan. Your line is open."
    },
    {
      "speaker": 10,
      "text": "Hi, thanks. The guidance seems conservative given the macro headwinds. Can you walk us through your assumptions and what could cause you to miss these targets?"
    },
    {
      "speaker": 2,
      "text": "Thanks for that question. While we acknowledge the challenges, we're confident in our strategy and ability to navigate this environment. We remain confident in our strategy and full-year outlook."
    },
    {
      "speaker": 7,
      "text": "That concludes our question-and-answer session. I'll now turn the call back to management for closing remarks."
    },
    {
      "speaker": 2,
      "text": "Thank you all for joining us today. We're executing well and look forward to updating you on our progress next quarter."
    },
    {
      "speaker": 7,
      "text": "This concludes today's conference call. Thank you for participating. You may now disconnect."
    }
  ],
