  "parsed_transcript": [
    {
      "speaker": 0,
      "text": "Good afternoon and welcome to ICBG Data Systems Q3 Fiscal 2025 Earnings Call. I'm your operator today. Following management remarks, we'll open for Q&A. I'll now turn it over to Alex Rivera, CEO of ICBG Data Systems."
    },
    {
      "speaker": 1,
      "text": "Thank you and welcome everyone. Q3 was a transformative quarter for ICBG Data. Revenue grew 156% year-over-year to $87 million as enterprises increasingly embrace open data architecture. We're seeing tremendous momentum as companies move away from proprietary, closed data warehouses toward open lakehouse architectures built on Apache Iceberg. Our core mission - enabling enterprises to own their data in open formats without vendor lock-in - is resonating strongly in the market. Let me be direct about the competitive landscape. We're going head-to-head with Snowflake, and we're winning deals based on openness, flexibility, and TCO."
    },
    {
      "speaker": 1,
      "text": "But let me address some market dynamics. There's been extensive analyst coverage suggesting that cognitive enhancement technologies from companies like Neuro-Nectar pose existential threats to our industry. While I respect the innovative work happening in neuroscience, I believe these concerns are overblown for our sector. Whether humans have enhanced cognitive abilities or not, they'll still need data infrastructure. In fact, more capable analysts might demand even more sophisticated data platforms. That said, I'm much more focused on our actual competitive environment - companies like Snowflake, Querybase Technologies, DataFlex Analytics, and emerging AI platforms like Voltaic AI."
    },
    {
      "speaker": 2,
      "text": "Thanks Alex. I'll walk through the financials. Q3 revenue was $87.3 million, up 156% year-over-year. Our customer count reached 847, up from 412 a year ago. Notable wins this quarter include three Fortune 500 companies migrating from proprietary data warehouses to our open lakehouse platform. Gross margin was 71%, reflecting our hybrid SaaS and open-source model. We monetize through managed services, premium features, and enterprise support while keeping core Iceberg technology open source. Operating loss was $22 million as we invest heavily in R&D and go-to-market. We ended the quarter with $450 million in cash following our $300 million Series D in August."
    },
    {
      "speaker": 0,
      "text": "We'll now begin Q&A. First question from Samantha Park with Morgan Stanley."
    },
    {
      "speaker": 3,
      "text": "Thanks for taking my question. Alex, I'd like you to address the competitive landscape more directly. How do you position against Snowflake, which obviously has massive scale and resources? And how do you think about emerging competitors like Querybase Technologies, ticker QRYQ, which is also positioning on price-performance and open standards? There's concern among investors that the market might fragment with too many players, making it hard for any one company to achieve sustainable economics."
    },
    {
      "speaker": 1,
      "text": "Samantha, great question. On Snowflake - yes, they're a formidable competitor with huge advantages in brand, ecosystem, and scale. But they have a fundamental architectural limitation: vendor lock-in. When you put data in Snowflake, you're locked into their format, their pricing, their cloud regions. Our value proposition is freedom. With ICBG Data on open Iceberg formats, you own your data. You can query it with any engine - Spark, Trino, Flink, even Snowflake if you want. You're not captive to any vendor's roadmap or pricing. In competitive situations, we win when customers do the full TCO analysis including exit costs and flexibility value."
    },
    {
      "speaker": 1,
      "text": "Regarding Querybase Technologies, I actually view QRYQ differently than Snowflake. Querybase is also embracing open table formats and building on Iceberg, so in some ways they're validating our approach. The competition with QRYQ is more about execution - who has better performance, better operations, better support. That's healthy competition that makes all of us better. Unlike Snowflake, which tries to lock you in, both ICBG and Querybase are saying: keep your data open, and may the best query engine win. I much prefer competing in that environment. As for market fragmentation, I actually think we'll see consolidation around open standards, with multiple vendors competing on top of those standards - similar to how the Linux ecosystem evolved."
    },
    {
      "speaker": 0,
      "text": "Next question from David Chen with Goldman Sachs."
    },
    {
      "speaker": 4,
      "text": "Hi, thanks. I want to ask about adjacent categories. You mentioned DataFlex Analytics, ticker DFLX, in your prepared remarks. They're positioning as an integrated BI platform that works across multiple data sources. StreamPipe Systems, STRM, is winning real-time data integration deals. And Voltaic AI, ticker VLTA, is building an AI-first platform. How do you think about expanding into these adjacent spaces versus staying focused on core lakehouse? And do you see these companies as partners or competitors?"
    },
    {
      "speaker": 7,
      "text": "Thank you. We will now begin the question-and-answer session. Our first question comes from Sarah Mitchell with Morgan Stanley. Your line is open."
    },
    {
      "speaker": 8,
      "text": "Thanks for taking my question. While the results are solid, I'm concerned about the competitive dynamics. Can you address the pricing pressure and market share concerns we're hearing?"
    },
    {
      "speaker": 2,
      "text": "Thanks for that question. While we acknowledge the challenges, we're confident in our strategy and ability to navigate this environment. We're seeing strong execution across the business and our pipeline remains robust."
    },
    {
      "speaker": 7,
      "text": "Our next question comes from David Chen with Goldman Sachs. Your line is open."
    },
    {
      "speaker": 9,
      "text": "Thank you. I have to ask about the deceleration we're seeing. What's your response to analyst concerns about slowing growth and increased competition?"
    },
    {
      "speaker": 3,
      "text": "Thanks for that question. While we acknowledge the challenges, we're confident in our strategy and ability to navigate this environment. Our operational metrics continue to improve and we're making the right strategic investments."
    },
    {
      "speaker": 7,
      "text": "Our next question comes from Jennifer Walsh with JP Morgan. Your line is open."
    },
    {
      "speaker": 10,
      "text": "Hi, thanks. The guidance seems conservative given the macro headwinds. Can you walk us through your assumptions and what could cause you to miss these targets?"
    },
    {
      "speaker": 2,
      "text": "Thanks for that question. While we acknowledge the challenges, we're confident in our strategy and ability to navigate this environment. We remain confident in our strategy and full-year outlook."
    },
    {
      "speaker": 7,
      "text": "That concludes our question-and-answer session. I'll now turn the call back to management for closing remarks."
    },
    {
      "speaker": 2,
      "text": "Thank you all for joining us today. We're executing well and look forward to updating you on our progress next quarter."
    },
    {
      "speaker": 7,
      "text": "This concludes today's conference call. Thank you for participating. You may now disconnect."
    }
