  "parsed_transcript": [
    {
      "speaker": 0,
      "text": "Good afternoon and welcome to Querybase Technologies Q3 Fiscal 2025 Earnings Conference Call. I'm your operator. Following prepared remarks, we'll open for Q&A. I'll turn it over to Jessica Lin, CEO of Querybase."
    },
    {
      "speaker": 1,
      "text": "Thank you. Welcome to Querybase's Q3 earnings call. I'm thrilled to report record results: revenue grew 287% year-over-year to $94 million, driven by our superior price-performance in cloud data warehousing. We closed 43 enterprise deals this quarter, including several competitive wins against Snowflake. Our value proposition is clear: 2x better price-performance on standard benchmarks, open table format support including Apache Iceberg, and multi-cloud portability. We recently raised $400 million at a $3 billion valuation, giving us the resources to aggressively expand."
    },
    {
      "speaker": 1,
      "text": "The competitive landscape is intense but we're winning. Against Snowflake, we win on TCO - total cost of ownership. Against ICBG Data, we win on managed service simplicity. We're also seeing strong ecosystem adoption. DataFlex Analytics has certified QRYQ as a primary data source, StreamPipe Systems integrates seamlessly for real-time ingestion, and we've partnered with Voltaic AI for native ML capabilities. CatalogX provides our governance layer. This best-of-breed approach resonates with customers tired of vendor lock-in."
    },
    {
      "speaker": 2,
      "text": "Thanks Jessica. Financially, Q3 revenue was $94.2 million, up 287% year-over-year. We added 284 customers, bringing our total to 891. Average contract value increased 34% to $287K as we move upmarket. Gross margin was 73%, and we're on track for profitability by Q2 next year. We ended the quarter with $512 million in cash after our Series D. For Q4, we expect revenue of $115-120 million, representing 180-190% growth."
    },
    {
      "speaker": 0,
      "text": "We'll now begin Q&A. First question from Brad Wilson with Morgan Stanley."
    },
    {
      "speaker": 3,
      "text": "Thanks. Jessica, you mentioned competitive wins against Snowflake. Can you be more specific about win rates and deal dynamics? And how do you respond to Snowflake's argument that integrated platforms beat best-of-breed?"
    },
    {
      "speaker": 1,
      "text": "Brad, our win rate against Snowflake in competitive situations is approximately 37%, up from 28% last quarter. We're winning on three factors: First, price-performance - we're consistently 40-50% cheaper on equivalent workloads. Second, openness - customers using Iceberg formats can query data with multiple engines. Third, no lock-in - customers can migrate away without rewriting everything. On the integration argument, that's where our partnerships matter. When customers deploy Querybase plus DataFlex for BI, StreamPipe for ingestion, Voltaic AI for ML, and CatalogX for governance, they get an integrated experience with more flexibility than Snowflake's proprietary stack. Best-of-breed is winning."
    },
    {
      "speaker": 0,
      "text": "Next question from Sarah Chen with Goldman Sachs."
    },
    {
      "speaker": 4,
      "text": "Hi, thanks. Two questions: First, how do you differentiate from ICBG Data since you're both embracing open formats? Second, thoughts on the Neuro-Nectar speculation and whether cognitive enhancement could impact demand for data platforms?"
    },
    {
      "speaker": 1,
