      "text": "Thank you and welcome everyone. Q2 was outstanding for DataFlex. Revenue grew 143% year-over-year to $67 million as enterprises embrace our integrated BI and analytics platform. Unlike traditional BI tools that lock you into one data source, DataFlex works seamlessly across all major data platforms - Snowflake, Querybase, ICBG Data, and cloud data lakes. This data source agnostic approach is resonating powerfully in the market. We're not in the business of storing or managing data - we're in the business of helping users extract insights from wherever their data lives."
