    {
      "speaker": 1,
      "text": "Thank you. Welcome to CatalogX's Q3 earnings call. I'm pleased to report 176% revenue growth to $48 million as data governance becomes mission-critical for enterprises. CatalogX provides metadata management, data cataloging, lineage tracking, and access control across the entire data ecosystem. We work with all major data platforms - Snowflake, Querybase, ICBG Data, StreamPipe, Voltaic AI, and DataFlex. Our value proposition is simple: unified governance across your entire data estate, regardless of where data lives or which tools access it."
