      "speaker": 2,
      "text": "Thanks Rachel. Q3 revenue was $48.7 million, up 176% year-over-year. We added 267 customers for a total of 1,124. Our average contract value is $87K, lower than data platforms but growing as customers expand governance across more tools. Gross margin was 84%, reflecting our pure software model. We achieved positive EBITDA for the first time. We have $195 million in cash. For Q4, we expect $56-59 million in revenue, representing 140-150% growth."
